काठमाण्डौ &amp;ndash; एशिया कप टी&amp;ndash;२० क्रिकेटमा आज भारत र ओमानले खेल्दैछन् । खेल नेपाली समय अनुसार बेलुका सवा ८ बजे युएईको आबुधावीमा शुरू हुनेछ ।

हिजो भएको खेलमा श्रीलङ्काले अफगानिस्तानलाई ६ विकेटले हरायो । योसँगै समूह &amp;lsquo;बी&amp;rsquo; बाट श्रीलङ्का र बङ्गलादेश सुपर ४ मा पुगेका छन् ।

समूह &amp;lsquo;ए&amp;rsquo; बाट भारत र पाकिस्तान सुपर ४ मा पुगिसकेका छन् । सुपर ४ मा सबै टोलीले एक अर्कासँग खेल्नेछन् । सुपर ४ का खेल भोलिदेखि शुरू हुनेछन् ।&amp;nbsp;

